import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div class="whole-nav">
      <div>
        <h2>Jobify</h2>
      </div>
      <nav className="navbar">
        <div>
          <Link to="/">Home</Link>
          <Link to="/jobs">Jobs</Link>
          <Link to="/dashboard">Dashboard</Link>
          <Link to="/dashboard">Dashboard</Link>
        </div>
      </nav>
      <div>
        <button>Login</button>
      </div>
    </div>
  );
}

export default Navbar;
